import React, { Component } from "react";
import "./index.css";
import './App.scss'
import Header from "./components/Header/Header";

class App extends Component {
  render() {
    return (
      <div className="App-container">
        <div className="App">
          <Header />
        </div>
      </div>
    );
  }
}

export default App;
